export const listArray = [
    {   name: "jajko", values:  ["na twardo", "na miękko", "jajecznica", "sadzone"]},
    {   name: "cebulka", values:  ["na twardo", "na miękko", "jajecznica", "sadzone"] },
    {   name: "herbata", values:  ["na twardo", "na miękko", "jajecznica", "sadzone"] },
    {   name: "kawusia", values:  ["na twardo", "na miękko", "jajecznica", "sadzone"] }
  ];

export const mapValues = index =>
listArray.values.map(( values, index) => {
  return(
    <li key={index}>
      {values}
    </li>
  )
})
